username\";s:5:\"admin\";s:5:\"title\";s:52:\"凯里官方:网吧隔壁危险化学品引发爆炸\";s:11:\"title_color\";s:0:\"\";s:10:\"title_bold\";s:1:\"0\";s:9:\"sub_title\";s:0:\"\";s:5:\"frame\";s:0:\"\";s:12:\"verify_frame\";s:0:\"\";s:3:\"url\";s:0:\"\";s:10:\"attributes\";s:0:\"\";s:7:\"summary\";s:251:\"贵州凯里网吧爆炸已造成6死38伤，官方称事件初步确定是由于网吧隔壁存放的大量危险化学品引发。据悉事发时网吧内有45人在上网。目前2名网吧负责人及存放化学品的业主已被警方控制。\r\n\";s:6:\"source\";s:0:\"\";s:6:\"author\";s:0:\"\";s:9:\"authority\";s:0:\"\";s:6:\"editer\";s:0:\"\";s:8:\"keywords\";s:0:\"\";s:8:\"verified\";s:1:\"1\";s:8:\"verifier\";s:0:\"\";s:11:\"verify_time\";s:1:\"0\";s:9:\"timestamp\";s:10:\"1291778207\";s:11:\"create_time\";s:1:\"0\";s:10:\"list_order\";s:10:\"1291778207\";s:11:\"update_time\";s:10:\"1291778222\";s:5:\"pages\";s:1:\"1\";s:18:\"html_view_url_rule\";s:0:\"\";s:8:\"template\";s:0:\"\";s:5:\"views\";s:2:\"18\";s:5:\"score\";s:1:\"0\";s:5:\"level\";s:1:\"0\";s:10:\"level_time\";s:1:\"0\";s:8:\"comments\";s:1:\"0\";s:12:\"seo_keywords\";s:0:\"\";s:15:\"seo_description\";s:0:\"\";s:13:\"label_postfix\";s:0:\"\";s:6:\"config\";s:0:\"\";s:8:\"custom_a\";s:0:\"\";s:8:\"custom_b\";s:0:\"\";s:8:\"custom_c\";s:0:\"\";s:8:\"custom_d\";s:0:\"\";s:8:\"custom_e\";s:0:\"\";}s:5:\"addon\";a:15:{s:2:\"id\";s:1:\"2\";s:3:\"iid\";s:1:\"2\";s:4:\"page\";s:1:\"1\";s:11:\"addon_title\";s:0:\"\";s:11:\"addon_frame\";s:0:\"\";s:13:\"addon_summary\";s:251:\"贵州凯里网吧爆炸已造成6死38伤，官方称事件初步确定是由于网吧隔壁存放的大量危险化学品引发。据悉事发时网吧内有45人在上网。目前2名网吧负责人及存放化学品的业主已被警方控制。\r\n\";s:2:\"ip\";s:13:\"192.168.1.175\";s:14:\"last_update_ip\";s:13:\"192.168.1.175\";s:9:\"timestamp\";s:10:\"1291778207\";s:7:\"content\";s:1742:\"<p>\r\n	　　<strong><img alt=\"12月5日，救援人员在现场施救。新华社发(陈沛亮 摄) \" src=\"<!--#p8_attach#-->/cms/item/2010_12/08_11/7a19ccbc3af02c79.jpg\" /></strong></p>\r\n<p>\r\n	　　12月5日，救援人员在现场施救。新华社发(陈沛亮 摄)</p>\r\n<p>\r\n	　　<span style=\"font-weight: bold\">新华网贵阳12月5日报道 </span>5日，贵州省凯里市网吧爆炸事件的原因已初步查明，为网吧隔壁一出租屋内存放的危险化学品发生爆炸引发。</p>\r\n<p>\r\n	　　记者从凯里市委、市政府了解到，截至目前，经州、市公安机关刑侦部门现场勘查，初步确认爆炸系由网吧一墙之隔的一小房间堆放的危险化学物品引发。爆炸现场位于凯里市清平南路桥下，房间内靠南墙堆放有三种袋装化学粉状物品，经查看包装袋，分别为高效聚氯化铝、氢氧化铝、亚硝酸钠，在袋装物品上还散落着若干玻璃瓶装液体，瓶上标签分别为硝酸、盐酸和石油醚。</p>\r\n<p>\r\n	　　现警方已将网吧业主陈成贵、邢光昌控制，并于5日凌晨将堆放危险化学物品的业主吴展智抓获。</p>\r\n<p>\r\n	　　据了解，该网吧已开业多年，证照齐全，共有140台电脑，爆炸时，网吧共有45人正在上网。</p>\r\n<p>\r\n	　　爆炸发生后，贵州省委书记栗战书作出批示，要求全力以赴开展救援，尽快查明爆炸原因，做好善后工作；省委常委、副省长黄康生立即从贵阳赶赴凯里指挥救援、看望伤员；省委常委、政法委书记崔亚东在公安厅指挥中心连夜指挥侦查。</p>\r\n<p>\r\n	　　目前，这起爆炸事件已造成6人死亡，38人受伤，其中9人重伤。</p>\r\n\";s:8:\"custom_f\";s:0:\"\";s:8:\"custom_g\";s:0:\"\";s:8:\"custom_h\";s:0:\"\";s:8:\"custom_i\";s:0:\"\";s:8:\"custom_j\";s:0:\"\";}}','','0');
