费项目以及来自商业银行语焉不详的解释引发社会普遍质疑。正当舆论质疑之声愈演愈烈时，监管部门的表态以及相关媒体由此引申的&ldquo;多项银行收费被叫停&rdquo;的报道让人们看到了希望。</p>\r\n<p>\r\n	　　国家发改委有关负责人7月28日就商业银行收费问题答记者问时表示：&ldquo;发展改革委已经配合有关部门研究起草了新的《商业银行服务价格管理办法》，发改委正在积极协调有关部门，对草案进行完善，争取尽快出台，以进一步规范商业银行收费行为，维护广大消费者利益&hellip;&hellip;&rdquo;</p>\r\n<p>\r\n	　　8月3日，银监会也发文说，正&ldquo;与国家发展改革委抓紧修订《商业银行服务价格管理暂行办法》&hellip;&hellip;将在征求各方意见后尽快发布&rdquo;。</p>\r\n<p>\r\n	　　然而，时隔数月，该办法不但没有&ldquo;尽快出台&rdquo;，甚至连公众意见也没有公开征求。</p>\r\n<p>\r\n	　　记者就此多次联系银监会及发改委的相关人士，询问该管理办法制定及征求意见进展情况，接受记者采访的银监会人士称&ldquo;领导忙于其他事务&rdquo;，发改委人士则称&ldquo;手中急件太多，等急件弄完再说&rdquo;，两部门人士始终不作正面回应。</p>\r\n<p>\r\n	　　据记者多方深入了解，除银行系统外，目前该办法征求意见工作仅在少数业内专家中小范围进行过。</p>\r\n<p>\r\n	　　&ldquo;既不出台，也不征求公众意见，公众甚至连该管理办法征求意见稿是个什么样子都不知道，感觉像平息公众质疑的权宜之计。&rdquo;采访中，一位银行客户的说法颇具代表性。</p>\r\n<p>\r\n	　　<strong>多方参与 为何公众声音独遭冷落</strong></p>\r\n<p>\r\n	　　商业银行服务价格的收取涉及到公众利益，其服务项目收费标准的制定和调整，理应听取包括商业银行、消费者组织及公众个人的意见。</p>\r\n<p>\r\n	　　然而，社会公众不仅从公开渠道看不到这份征求意见稿，记者辗转相关部门、被征求意见专家以及多家商业银行，也未能看到这份&ldquo;神秘&rdquo;的征求意见稿，来自银行和专家的说法是&ldquo;要保密&rdquo;。</p>\r\n<p>\r\n	　　而早在今年8月份银监会有关负责人在接受媒体采访时就表示，目前征求意见稿主要针对商业银行收集信息，约持续两周时间。各大商业银行当时亦表示已收到征求意见稿，并将积极反馈意见。</p>\r\n<p>\r\n	　　待遇的不同，不仅如此。</p>\r\n<p>\r\n	　　银监会和发改委在2003年出台的《商业银行服务价格管理暂行办法》就明文规定&ldquo;商业银行就前款事项(商业银行依据本办法制定服务价格)报告中国银行业监督管理委员会的同时，应抄送中国银行业协会&rdquo;。丝毫未提及作为公众利益发声载体的消费者协会或者其他组织。</p>\r\n<p>\r\n	　　作为银行业行业自律组织的银行业协会在年中关于银行收费的舆论质疑声中，发表意见称商业银行上调有关服务收费合法合规，遭多方诟病。</p>\r\n<p>\r\n	　　在采访中，银监会一位内部人士告诉记者，在商业银行服务价格管理办法的起草过程中，银行业协会参与了其中的部分工作，&ldquo;具体情况应该问他们&rdquo;。银行业协会人士则向记者表示，参与了管理办法起草的前期工作，但不清楚后续进展。</p>\r\n<p>\r\n	　　而消费者协会一位副会长在接受记者采访时十分无奈地说：&ldquo;消协在这次商业银行服务价格管理办法起草中基本上被冷场。&rdquo;</p>\r\n<p>\r\n	　　<strong>监管机构：是&ldquo;教练员&rdquo;还是&ldquo;裁判员&rdquo;</strong></p>\r\n<p>\r\n	　　显然，这项管理办法的制定与出台是一场多方利益的博弈。在此过程中，究竟谁能代表公众利益发声呢?</p>\r\n<p>\r\n	　　&ldquo;公众利益的代表，一方面是公权力机构，另一方面是一些社会团体。&rdquo;中国人民大学法学院教授刘俊海在接受记者采访时说，国家发改委、银监会均应代表公众利益。</p>\r\n<p>\r\n	　　然而，不为广大公众所知的是，作为银行业监管部门的银监会，每年均向商业银行征收银行业机构监管费和业务监管费。</p>\r\n<p>\r\n	　　记者手持的由国家发改委联合财政部于2007年12月及今年9月发布的两份通知表明，银行业机构监管费和业务监管费的征收额度与银行实收资本及资产总额存在关联。</p>\r\n<p>\r\n	　　与之相关，手续费及佣金净收入已成为拉动银行业绩增长的重要引擎。上市银行半年报显示，可统计的15家上市银行手续费及佣金净收入较去年同期增长382.92亿元，涨幅达35.13%，商业银行手续费及佣金增速普遍已超过传统息差收入。</p>\r\n<p>\r\n	　　&ldquo;正因为与此相关的利益勾连，银行业监管部门为商业银行收费行为充当&lsquo;保护伞&rsquo;，导致银行乱收费、乱涨价等行为一再上演。&rdquo;北京两高律师事务所律师董正伟十分犀利地指出。</p>\r\n<p>\r\n	　　2003年出台的《商业银行服务价格管理暂行办法》规定，除人民币基本结算类业务和银监会、国家发改委根据对个人、企事业的影响程度以及市场竞争状况确定的商业银行服务项目外，商业银行提供的其他服务实行市场调节价。实行市场调节价的服务价格，由商业银行总行自行制定和调整。</p>\r\n<p>\r\n	　　而这也正是今年年中众多商业银行单方面设定服务收费或上调服务收费标准的重要依据。</p>\r\n<p>\r\n	　　不少法律界人士却质疑其与现行《商业银行法》相抵触。《商业银行法》第五十条规定，商业银行收费项目和标准，由国务院银行业监督管理机构、中国人民银行根据职责分工，分别会同国务院价格主管部门制定。</p>\r\n<p>\r\n	　　细心的人士注意到，与此前出台的《商业银行服务价格管理暂行办法》只提&ldquo;市场调节价&rdquo;&ldquo;政府指导价&rdquo;、不提对公众相对有利的&ldquo;政府定价&rdquo;不同，发改委在答记者问中提出，商业银行服务收费依据其性质、特点和市场竞争状况，分别实行政府指导价、政府定价或市场调节价。</p>\r\n<p>\r\n	　　而银监会的发文丝毫未提及政府定价。</p>\r\n<p>\r\n	　　中国政法大学教授吴景明指出，措辞不同，可以看出二者立场有差异。</p>\r\n<p>\r\n	　　&ldquo;政府定价介入力度更大，政府定价机制是同企业某些见利忘义行为相抗衡的有效制度。&rdquo;刘俊海说。</p>\r\n<p>\r\n	　　&ldquo;这种差异，或许正是新规迟迟不见下文的重要原因。&rdquo;董正伟猜测说。</p>\r\n<p>\r\n	　　由于采访两部委未获正面回应，记者尚无法求证，上述猜测是否就是新办法迟迟未见进展的真实原因。</p>\r\n<p>\r\n	　　不过，法律界人士在接受记者采访时普遍认为，作为履行公共管理职能的部门，不宜成为利益攸关方，否则难以站在公正立场维护公众利益。</p>\r\n<p>\r\n	　　&ldquo;这也是商业银行不断出台收费项目、调整收费价格，老百姓反响强烈，却得不到银行监管机构任何有效制止的根源所在。&rdquo;吴景明说。</p>\";s:8:\"custom_f\";s:0:\"\";s:8:\"custom_g\";s:0:\"\";s:8:\"custom_h\";s:0:\"\";s:8:\"custom_i\";s:0:\"\";s:8:\"custom_j\";s:0:\"\";}}','','0');
