s:3:\"uid\";s:1:\"1\";s:8:\"username\";s:5:\"admin\";s:5:\"title\";s:64:\"世青赛中国女乒1-3日本8年首次丢冠 男乒3比0登顶\";s:11:\"title_color\";s:0:\"\";s:10:\"title_bold\";s:1:\"0\";s:9:\"sub_title\";s:0:\"\";s:5:\"frame\";s:0:\"\";s:12:\"verify_frame\";s:0:\"\";s:3:\"url\";s:0:\"\";s:10:\"attributes\";s:0:\"\";s:7:\"summary\";s:286:\"　　新浪体育讯　北京时间12月9日消息，在斯洛文尼亚进行的乒乓球世青赛女团决赛中，中国女队1比3不敌石川佳纯领衔的日本队，仅获得亚军。这也是中国女乒八年来首次无缘世青赛冠军。男团决赛中国队则以3比0完\";s:6:\"source\";s:0:\"\";s:6:\"author\";s:0:\"\";s:9:\"authority\";s:0:\"\";s:6:\"editer\";s:0:\"\";s:8:\"keywords\";s:0:\"\";s:8:\"verified\";s:1:\"1\";s:8:\"verifier\";s:0:\"\";s:11:\"verify_time\";s:1:\"0\";s:9:\"timestamp\";s:10:\"1291882117\";s:11:\"create_time\";s:1:\"0\";s:10:\"list_order\";s:10:\"1291219200\";s:11:\"update_time\";s:10:\"1291882117\";s:5:\"pages\";s:1:\"1\";s:18:\"html_view_url_rule\";s:0:\"\";s:8:\"template\";s:0:\"\";s:5:\"views\";s:2:\"16\";s:5:\"score\";s:1:\"0\";s:5:\"level\";s:1:\"0\";s:10:\"level_time\";s:1:\"0\";s:8:\"comments\";s:1:\"0\";s:12:\"seo_keywords\";s:0:\"\";s:15:\"seo_description\";s:0:\"\";s:13:\"label_postfix\";s:0:\"\";s:6:\"config\";s:0:\"\";s:8:\"custom_a\";s:0:\"\";s:8:\"custom_b\";s:0:\"\";s:8:\"custom_c\";s:0:\"\";s:8:\"custom_d\";s:0:\"\";s:8:\"custom_e\";s:0:\"\";}s:5:\"addon\";a:15:{s:2:\"id\";s:2:\"26\";s:3:\"iid\";s:2:\"43\";s:4:\"page\";s:1:\"1\";s:11:\"addon_title\";s:0:\"\";s:11:\"addon_frame\";s:0:\"\";s:13:\"addon_summary\";s:298:\"　　新浪体育讯　北京时间12月9日消息，在斯洛文尼亚进行的乒乓球世青赛女团决赛中，中国女队1比3不敌石川佳纯领衔的日本队，仅获得亚军。这也是中国女乒八年来首次无缘世青赛冠军。男团决赛中国队则以3比0完胜日本队\";s:2:\"ip\";s:13:\"192.168.1.175\";s:14:\"last_update_ip\";s:13:\"192.168.1.175\";s:9:\"timestamp\";s:10:\"1291882117\";s:7:\"content\";s:3636:\"<p>\r\n	　　新浪体育讯　北京时间12月9日消息，在斯洛文尼亚进行的乒乓球世青赛女团决赛中，中国女队1比3不敌石川佳纯领衔的日本队，仅获得亚军。这也是中国女乒八年来首次无缘世青赛冠军。男团决赛中国队则以3比0完胜日本队夺冠。</p>\r\n<p>\r\n	　　<strong>女团：中国1-3日本</strong></p>\r\n<p>\r\n	　　日本队历史突破的最大功臣在于17岁的石川佳纯，她接连击败朱雨玲和顾玉婷，另外一场胜利来自于谷冈阿尤卡，她击败中国易芳贤；顾玉婷击败森园美咲赢得唯一一场胜利。详细比分为：朱雨玲2比3石川佳纯、顾玉婷3比1森园美咲、易芳贤2比3谷冈阿尤卡(音译)、顾玉婷0比3石川佳纯。</p>\r\n<p>\r\n	　　率先为中国队登场的是朱雨玲，朱雨玲在今年的日本公开赛上不敌王越古夺得亚军，一鸣惊人。而石川佳纯则是中国观众熟悉的福原爱之后的日本女乒代表。相对来讲，石川佳纯的大赛经验更为丰富。第一局，石川佳纯便以11比9拿下，第二局竞争格外胶着，一直到15比13，石川佳纯2比0领先，被逼到绝路的朱雨玲放手一搏，以11比6和11比7连扳两局，可惜的是决胜局石川佳纯轻松11比3拿下。中国队0比1落后。</p>\r\n<p>\r\n	　　第二场是中国顾玉婷，她也是2010年新加坡青奥会女单冠军得主，和森园美咲的较量中，两人前两局各有胜负，第三局11比8顾玉婷拿下，第四局两人打出16比14的高分，顾玉婷3比1胜出，中国队1比1平。</p>\r\n<p>\r\n	　　第三场由来自武汉的易芳贤出战，她在今年2月的直通赛中胜出从二队上升至一队，对手则是日本队的谷冈阿尤卡。第一局谷冈11比9拿下，易芳贤随后还以两个11比4，谁料第四局谷冈11比7实现逆转；决胜局，易芳贤再度失利，9比11不敌对手，中国队1比2落后。</p>\r\n<p>\r\n	　　第四场，由青奥会冠军顾玉婷迎战石川佳纯。中国队大比分落后，再输一场将丢冠。心理压力骤增的顾玉婷崩盘，7比11、6比11和8比11连输三局，不敌石川佳纯。成年组莫斯科世乒赛崩盘之后，世青赛上中国队再度落败，1比3，无缘女团冠军。这也是中国队八年来首度无缘女团世青赛冠军。</p>\r\n<p>\r\n	　　<strong>男团：中国3-0日本</strong></p>\r\n<p>\r\n	　　男女团冠军的较量都是中国与日本，虽然女队的姑娘们1比3落败，但男队的小伙子们顶住了日本队的强烈冲击，以3比0锁定胜局，其中周雨3比0击败吉田雅己，吴家骥3比2险胜丹羽孝希，林高远3比0击败平野友树。</p>\r\n<p>\r\n	　　首场比赛周雨的胜出显得相对容易，11比6、11比7和11比2，非常轻松；第二场吴家骥和丹羽孝希之间的较量则格外惊心动魄，首局吴家骥13比11拿下，接着5比11和4比11连丢两局；第四局，吴家骥11比9艰难胜出；关键的决胜局，吴家骥7比10落后，丹羽孝希手握三个赛点，而吴家骥此时发挥神勇连追三分，10平！丹羽孝希赢得接下来的一分，第四个赛点出现，吴家骥依旧沉着挽救赛点成功，并赢得接下来的两分，逆转成功！五局大战，吴家骥终于拿下。</p>\r\n<p>\r\n	　　第三场林高远迎战日本平野友树，他也是日本名将平野早矢香的弟弟。日本队0比2落后的情况下，平野友树也未能抵挡住中国队的攻势，7比11、6比11、6比11，平野友树0比3不敌林高远，中国队也3比0胜出，夺得男团冠军。(安然)</p>\r\n\";s:8:\"custom_f\";s:0:\"\";s:8:\"custom_g\";s:0:\"\";s:8:\"custom_h\";s:0:\"\";s:8:\"custom_i\";s:0:\"\";s:8:\"custom_j\";s:0:\"\";}}','','0');
