INSERT INTO `p8_forms_item_project` (`id`,`diqu`,`sudi`,`name`,`leibie`,`touzhi`,`niandu`,`bianhao`,`lxdw`,`xiangmuzhuangtai`,`beizhu`,`fujian`) VALUES ('4662','西宁市','','牛羊肉加工及废弃物综合利用项目','轻工农牧业产业化','1--5亿','2019','','湟源县经济商务和信息化局','1','<p>一、项目提出的背景<br />\r\n1、市场分析：该项目立足青海省西宁市丰富的农牧业资源，积极开发青藏高原无污染、绿色、有机的农畜产品，打造绿色品牌，生产绿色产品，对调整农牧业产业结构，提升农畜产品加工科技水平，延长产业链条起着重要的作用。<br />\r\n2、地区优势<br />\r\n（1）产业优势：牛羊肉加工及废弃物综合利用项目，该项目充分利用农畜成品的边角料和畜禽的内脏、骨骼等组织，采用生化工艺将动物组织蛋白、微生物蛋白等经酸、碱、酶水解将蛋白质最终转化为小肽和氨基酸混合物，加工成蛋白胨系列产品。<br />\r\n（2）区位优势：西宁地处青藏高原东北部，地处黄土高原与青藏高原结合部，历史上中原农耕文明与西部草原文化在此相交，是连接藏区与中原地区的重要节点，形成了背靠大牧场、面向大市场的独特优势，为发展该项目提供了广阔的发展空间。<br />\r\n二、主要原材料供应情况<br />\r\n供应量充足。<br />\r\n三、项目基本情况<br />\r\n&nbsp; &nbsp; 建设内容主要包括原料区、生产区、成品区、和其他配套工程等。本项目利用动物杂骨生产工业蛋白胨、骨粒、骨油、骨粉等产品。工业蛋白胨是从生产骨粒的废水中提取的，利用动物杂骨进行深加工。<br />\r\n四、建设条件<br />\r\n&nbsp; 建设地点位于湟源大华工业园区，距离湟源县县城7公里，距离省会城市55公里，315国道、西格铁路穿区而过，区位优势十分明显。<br />\r\n五、现阶段项目进展<br />\r\n&nbsp; 正在招商。<br />\r\n六、投资概算、合作方式及经济效益<br />\r\n&nbsp; 项目总投资20000万元，其中：固定投资资产为13000万元，占总投资的65%；流动资金为7000万元，占总投资的35%。<br />\r\n七、优惠政策<br />\r\n&nbsp; 享受西部大开发优惠政策。<br />\r\n八、联系方式<br />\r\n联系单位：湟源县经济商务和信息化局<br />\r\n联系人：星胜周<br />\r\n电话：0971&mdash;2437834<br />\r\n传真：0971&mdash;2432027<br />\r\n电子邮箱：hyxswj@163.com</p>\r\n','');
INSERT INTO `p8_forms_item_project` (`id`,`diqu`,`sudi`,`name`,`leibie`,`touzhi`,`niandu`,`bianhao`,`lxdw`,`xiangmuzhuangtai`,`beizhu`,`fujian`) VALUES ('4663','西宁市','','年加工1亿瓶高原特色饮料加工项目','轻工农牧业产业化','1--5亿','2019','','湟源县经济商务和信息化局','1','<p>一、项目提出的背景<br />\r\n1、市场分析：随着人们生活水平的不断提高，人们对健康的诉求也日益提高，&ldquo;高原特色饮料&rdquo;，正是基于人们的这种诉求开发出的新一代健康饮品，其原料如、沙棘、黑枸杞、胡萝卜等来自天然纯净的青藏高原，因其是公认的高原特色植物，其富含蛋白质、氨基酸、维生素、矿物质、微量元素等多种营养成分，利用先进的冷萃工艺将植物中95%以上的营养元素无破坏的提取出来，做成可以随身携带的饮料，享受健康可以随时随地，高原特色饮料口味独特，老少皆宜，不仅可以消暑解渴，更能补充多种营养元素。<br />\r\n2、地区优势<br />\r\n（1）产业优势：高原特色饮料加工项目，随着居民收入水平的不断提高，饮料生产量和消费量持续增长，消费者对天然、低糖、健康型饮料的需求，促进了果蔬汁饮料、茶饮料、瓶装饮用水、功能型饮料等新品种的崛起。<br />\r\n（2）区位优势：西宁地处青藏高原东北部，地处黄土高原与青藏高原结合部，历史上中原农耕文明与西部草原文化在此相交，是连接藏区与中原地区的重要节点，形成了背靠大牧场、面向大市场的独特优势，为发展该项目提供了广阔的发展空间。<br />\r\n二、主要原材料供应情况<br />\r\n&nbsp; 特色高原植物供应量充足。<br />\r\n三、项目基本情况<br />\r\n&nbsp; &nbsp; 计划总占地面积约为200亩，项目充分利用青藏高原特色植物资源建设高原特色饮料无菌灌装生产线，年加工1亿瓶高原特色饮料生产线一条。<br />\r\n四、建设条件<br />\r\n&nbsp; 建设地点位于湟源大华工业园区，距离湟源县县城7公里，距离省会城市55公里，315国道、西格铁路穿区而过，区位优势十分明显。<br />\r\n五、现阶段项目进展<br />\r\n&nbsp; 正在招商。<br />\r\n六、投资概算、合作方式及经济效益<br />\r\n&nbsp; 项目总投资20000万元，其中：固定投资资产为13000万元，占总投资的65%；流动资金为7000万元，占总投资的35%。<br />\r\n七、优惠政策<br />\r\n&nbsp; &nbsp; 享受西部大开发优惠政策。<br />\r\n八、联系方式<br />\r\n联系单位：湟源县经济商务和信息化局<br />\r\n联系人：星胜周<br />\r\n电话：0971&mdash;2437834<br />\r\n传真：0971&mdash;2432027<br />\r\n电子邮箱：hyxswj@163.com</p>\r\n','');
