INSERT INTO `p8_label` (`id`,`system`,`module`,`site`,`env`,`source_system`,`source_module`,`name`,`type`,`option`,`content`,`invoke`,`variable`,`timestamp`,`last_update`,`ttl`,`postfix`,`update_time`,`last_setter`) VALUES ('9106','core','letter','','','','','hdjl-letter_top','html','a:4:{s:7:\"bgcolor\";s:0:\"\";s:13:\"allowed_roles\";a:0:{}s:18:\"place_holder_width\";s:2:\"60\";s:19:\"place_holder_height\";s:2:\"20\";}','<span style=\"color:#b22222;\"><span style=\"font-size:12px;\"><strong>写信注意事项：</strong></span></span><br /><br />\r\n<p>\r\n	\r\n	<span style=\"font-size:12px;\">1.投诉人真实姓名、电子邮件、电话（一定要有区号，最好留手机号码）。以方便我们及时与您联系。<br /><br />\r\n	\r\n	2.投诉信息中，可填写详细的被投诉对象名称、联系方式，方便我们快速受理跟进。<br /><br />\r\n	\r\n	3.在具体内容中，应写明投诉事件发生发经过，包括时间、地点和当事人（包括被投诉方）。最后定明你的投诉要点和要求。<br /><br />\r\n	\r\n	4.不允许发表任何非法的、骚扰性的、中伤他人的、伤害性的、庸俗的，淫秽等信息资料。</span><br />\r\n	</p>','$label[hdjl-letter_top]','0','1440686650','1564029319','300','','1440686650','');
