INSERT INTO `p8_label` (`id`,`system`,`module`,`site`,`env`,`source_system`,`source_module`,`name`,`type`,`option`,`content`,`invoke`,`variable`,`timestamp`,`last_update`,`ttl`,`postfix`,`update_time`,`last_setter`) VALUES ('14409','cms','item','','','','','group1_chm_con1','html','a:4:{s:7:\"bgcolor\";s:0:\"\";s:13:\"allowed_roles\";a:0:{}s:18:\"place_holder_width\";s:2:\"60\";s:19:\"place_holder_height\";s:2:\"20\";}','<p>同志们，朋友们：</p>\r\n\r\n<p>2016农历新年即将到来。在这个辞旧迎新的美好时刻，我谨代表山东重工集团、潍柴集团管理团队，并以我个人的名义，向海内外全体员工及家属，向在各个时期为企业发展做出贡献的老领导、离退休员工，以及长期以来关心支持企业发展的社会各界朋友们致以节日的问候！祝大家新春快乐、阖家幸福！</p>\r\n\r\n<p>刚刚过去的2015年是不平凡的一年。外部经济形势严峻复杂，多种不利因素叠加，企业面临前所未有的挑战，全体干部员工齐心协力、攻坚克难，依然取得了令人鼓舞的经营业绩。这一年，我们深化改革、提质增效，企业运营质量和效率进一步提高，盈利水平继续保持行业领先；这一年，我们把握核心、创新驱动，科技研发水平得到国家高度认可，企业核心竞争力逐步增强；这一年，我们积极推动两化融合，主动拥抱工业互联网，智能制造成为行业典范；这一年，我们谋划布局、精耕细作，海外业务板块稳步增长，成为支撑企业持续健康发展的重要保障。</p>\r\n\r\n<p>2015年也是&ldquo;十二五&rdquo;的收官之年。五年来，我们充分把握外部有利机遇，持续强化自身建设，企业产业布局更加完善，业务结构日趋合理，核心竞争力不断提高，国际化、多元化水平持续提升，综合实力和品牌影响力显著增强。五年间，我们取得了历史上最佳的发展业绩，探索出了一条独具潍柴特色的可持续发展之路，在企业的发展史上写下了浓墨重彩的一笔！</p>\r\n\r\n<p>成绩的取得，离不开全体干部员工的辛勤付出，我们为自己骄傲；离不开广大合作伙伴的鼎力支持，以及社会各界的大力帮助，我们对此心怀感恩。成绩的取得，更给了我们披荆斩棘的信心和砥砺前行的力量，我们将以此为基石，自信面对未来更大的挑战。</p>\r\n\r\n<p>2016年是&ldquo;十三五&rdquo;开局之年，也是充满挑战的一年。挑战蕴含机遇，压力激发动力。我们要认清当前形势，统一思想认识，坚定必胜信心，增强主动作为意识，以&ldquo;六大战略思路&rdquo;为指导，用好&ldquo;六大抓手&rdquo;，坚决打赢&ldquo;三大战役&rdquo;，实现&ldquo;3+1目标&rdquo;。我们将坚定不移主动改革创新，加快推动战略转型，充分激发发展活力；我们将不断提高精细化管理水平，科学降低企业运营成本，拓宽企业发展空间；我们将强化市场客户意识，加强三个核心竞争力建设，提升差异化竞争优势；我们将继续深化协同发展，提高国际化运营水平，实现海外企业全面盈利；我们将坚持&ldquo;四个永葆&rdquo;，强化责任担当，努力打造适应新常态发展的干部员工队伍。没有比脚更长的路，没有比人更高的山。只要我们齐心协力，矢志发展，就一定可以拥有更强的发展动力，创造更加美好的明天！</p>\r\n\r\n<p>同志们，朋友们！站在新的起点上，我们迎难而上的信心愈加坚定，改革创新的步伐愈加有力。让我们凝心聚力、攻坚克难，在潍柴七十周年华诞的里程碑上，书写新的发展篇章！</p>\r\n\r\n<p>最后，祝愿大家新春快乐、幸福安康！</p>\r\n\r\n<p align=\"right\">&nbsp;</p>\r\n\r\n<p align=\"right\">山东重工集团、潍柴控股集团董事长</p>\r\n\r\n<p align=\"right\"><img alt=\"\" oldsrc=\"W020160205525688680942.jpg\" src=\"{$SKIN}images/W020160205525688680942.jpg\" style=\"border-left-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-top-width: 0px\" /></p>\r\n\r\n<p align=\"right\">2016年2月7日</p>\r\n','$label[group1_chm_con1]','0','1469581837','1662427561','300','','1469581837','');
